import React from "react";
import Header from "./components/Header";
import Section from "./components/Section";

import Navbar from "./components/Navbar";

const styles = {
  navbar: {
    margin: 20,
    background: "#e8eaf6"
  },
  header: {
    background: "#3f51b5",
    minHeight: 50,
    lineHeight: 3.5,
    fontSize: "1.2rem",
    color: "white",
    padding: "0 20px"
  },
  section: {
    padding: 20
  }
};

function App() {
  return (
    <div>
      <div style={styles.navbar}></div>
      <div style={styles.header}></div>
      <div style={styles.section}></div>
    </div>
  );
}

export default App;
